import React from "react";
import "./ToDoItem.css";
import {
  Row,
  Col,
  Card,
  Form,
  Input,
  DatePicker,
  Layout,
  Button,
  Modal,
} from "antd";

const ToDoItem = (props) => {
  return (
    // <div className="to-do-item">
    <Card>
      <p className="to-do-text">{props.text}</p>
      <p
        className="to-do-remover"
        onClick={() => {
          props.onChecked(props.id);
        }}
      >
        X
      </p>
    </Card>
    // </div>
  );
};

export default ToDoItem;
